import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Home from './Pages/Home';

function App() {
  return (
    <Switch>
      <Route exact path="/" component={ Home }/>
    <div> hello word</div>
    </Switch>
  );
}

export default App;
